import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import BookingFormSection from '../components/booking/BookingFormSection';
import RoomSelectionSection from '../components/booking/RoomSelectionSection';
import GuestInfoSection from '../components/booking/GuestInfoSection';
import SpecialRequestsSection from '../components/booking/SpecialRequestsSection';
import BookingSummarySection from '../components/booking/BookingSummarySection';
import BookingConfirmationSection from '../components/booking/BookingConfirmationSection';

const BookingPage = () => {
  return (
    <div className="BookingPage">
      <Navbar />
      <main className="pt-24">
        <BookingFormSection />
        <RoomSelectionSection />
        <GuestInfoSection />
        <SpecialRequestsSection />
        <BookingSummarySection />
        <BookingConfirmationSection />
      </main>
      <Footer />
    </div>
  );
};

export default BookingPage;
